import React from "react";
import { useState  } from "react";

import { Container, Input, Item, Left, Right } from "./contextNav";
import { RiYoutubeFill } from "react-icons/ri";

const ContextNavbar = () => {
  const [modal , setModal] = useState("")
  console.log(modal);
  return (
    <Container>
      <Left>
        <RiYoutubeFill />
        <>YouTube </>
      </Left>

      <Right>
        <Input onChange={(e)=> setModal(e.target.value)} type="text" />

        <Item>Home</Item>
        <Item>Count </Item>
      </Right>
    </Container>
  );
};

export default ContextNavbar;
